import React from "react";
import ProfileButton from "./ProfileButton";
import { useNavigate } from "react-router-dom";

const Profile: React.FC = () => {
  const navigate = useNavigate();

  const handleClick = () => {
    console.log("Button clicked!");
  };

  const handler = () => {
    navigate("/home");
  };

  return (
    <div
      style={{
        backgroundColor: "red",
        height: "100vh",
        backgroundSize: "cover",
        backgroundRepeat: "no-repeat",
        backgroundPosition: "center",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        position: "relative",
      }}
    >
      <div
        style={{
          padding: "100px",
          position: "absolute",
          top: "0",
          left: "0",
          right: "0",
          bottom: "0",
          backgroundColor: "rgba(0, 0, 0, 0.5)",
          color: "white",
          display: "flex",
          textAlign: "center",
          justifyContent: "center",
          zIndex: "1",
        }}
      >
        <h1>Welcome!</h1>
        <ProfileButton 
          style={{}}
          onClick={handleClick} size={100}>Click me</ProfileButton>
      </div>
    </div>
  );
};

export default Profile;
